      State.Value.Native(s.tipe, 0, (if (e.isObject) e else extractValue[Any](e)) +: extractValue[IS[ZLike[_], Any]](s))
    else
      State.Value.Native(s.tipe, 0, (if (e.isObject) e else extractValue[Any](e)) +: extractValue[MS[ZLike[_], Any]](s))
